def find_min_rent_price(n, k, s, t, cars, stations):

    def can_reach_cinema(V, S, T, stations):
        m = len(stations)
        t = 0
        stations.append(S)
        prev = 0
        for cur in stations:
            dis = cur - prev
            if dis > V:
                return False
            else:
                t += max(dis * 3 - V, dis)
            if t > T:
                return False
            prev = cur
        return True

    def find_min_fuel_capacity(S, T, stations):
        l = 0
        r = S * 2
        if T < S:
            return float('inf')
        while l + 1 < r:
            m = l + (r - l) // 2
            if can_reach_cinema(m, S, T, stations):
                r = m
            else:
                l = m
        return r
    stations.sort()
    min_volume = find_min_fuel_capacity(s, t, stations)
    if min_volume != float('inf'):
        return -1
    min_price = float('inf')
    for (price, volume) in cars:
        if volume >= min_volume:
            min_price = min(min_price, price)
    return min_price if min_price != float('inf') else -1

